import React, { useState } from "react";

function DisplayNames(props) {
  let [search, setSearch] = useState([]);

  function searching(event) {
    let babyName = event.target.value;
    console.log(babyName);

    props.data
      .filter((nameB) => {
        return nameB.name.includes(babyName);
      })
      .map((el) => setSearch(trial(el, el.id)));
  }

  function trial(l, d) {
    if (l.sex === "f") {
      console.log(l);
      console.log(d);
      <DisplayNames />;
    } else {
      return (
        <span key={d} className="blue">
          {" "}
          {l.name}{" "}
        </span>
      );
    }
  }

  return (
    <p>
      {props.data
        .sort((a, b) => a.name.localeCompare(b.name))
        .map((el, id) => {
          if (el.sex === "f") {
            return (
              <span key={id} className="orange">
                {" "}
                {el.name}{" "}
              </span>
            );
          } else {
            return (
              <span key={id} className="blue">
                {" "}
                {el.name}{" "}
              </span>
            );
          }
        })}
    </p>
  );
}

export default DisplayNames;
